The full format is conceptually the simplest representation of data in Signal K. It contains all of the data from a Signal K node, which in the case of a Signal K server could be many hundreds of data points. { "version": "1.0.0", "self": "urn:mrn:signalk:uuid:705f5f1a-efaf-44aa-9cb8-a0fd6305567c", "vessels": { "urn:mrn:signalk:uuid:705f5f1a-efaf-44aa-9cb8-a0fd6305567c": { "navigation": { "speedOverGround": { "value": 4.32693662, "$source": "ttyUSB0.GP", "sentence": "RMC", "timestamp": "2017-05-16T05:15:50.007Z" }, "position": { "value": { "altitude": 0.0, "latitude": 37.81479, "longitude": -122.44880152 }, "$source": "ttyUSB0.GP", "sentence": "RMC", "timestamp": "2017-05-16T05:15:50.007Z" }, "headingMagnetic": { "value": 5.55014702, "$source": "ttyUSB0.II", "sentence": "HDM", "timestamp": "2017-05-16T05:15:54.006Z" } }, "name": "Motu", "uuid": "urn:mrn:signalk:uuid:705f5f1a-efaf-44aa-9cb8-a0fd6305567c" } }, "sources": { "ttyUSB0": { "label": "ttyUSB0", "type": "NMEA0183", "GP": { "talker": "GP", "sentences": { "RMC": "2017-04-03T06:14:04.451Z" } }, "II": { "talker": "II", "sentences": { "HDM": "2017-05-16T05:15:54.006Z" } } } }
} There are several top level attributes or keys which are always present and others which are optional. The version key specifies which version of the Signal K specification is being used and must always present in a full Signal K model. Also always present in the full model is the self key. The value of self is the key within the vessels object which is the local boat. Effectively, it is a pointer into the vessels object. Below the vessels object is a list of vessels, identified by their MMSI number or a generated unique ID. There may be many vessels if data has been received from AIS or other sources. The format for each vessel’s data uses the same standard Signal K structure but may not have the same content; likely you will not have as much data about other vessels as you have about your own. At the same level as vessels is sources. This contains a list of sources the data was obtained from. Each data object within a vessel may have a $source key which point to a source within sources. Several data objects may reference the same source since a single NMEA sentence or PGN may map to multiple keys in Signal K. Alternatively the source data may be embedded directly in place of the $source by using the source key: { "vessels": { "urn:mrn:signalk:uuid:705f5f1a-efaf-44aa-9cb8-a0fd6305567c": { "navigation": { "position": { "value": { "altitude": 0.0, "latitude": 37.81479, "longitude": -122.44880152 }, "source": { "label": "ttyUSB0", "type": "NMEA0183", "talker": "GP", "sentence": "PRMC" }, "timestamp": "2017-05-16T05:15:50.007Z" } } } }
} For more information on sources, see the sources section. Data objects in Signal K are organized hierarchically, for example data related to navigation such as position, speed through water and heading are all organized under a navigation sub-topic within the vessel object. Each data object has a value property which holds the actual value for that specific key. The value property may contain a number, a string or another object. Signal K keys that are object valued are object valued because the values don‘t have much semantic meaning individually. For example position – latitude doesn‘t have much meaning without an associated longitude. Therefore, these (and altitude) are grouped together in a single navigation.position key. The values are always SI units, and always the same units for the same key. Therefore, speedOverGround is always meters per second, never knots, km/hr, or miles/hr. This means you never have to send units with data, the units are specific for a key, and defined in the data schema. A simplified version of the JSON schema with the units is available in Keys Reference in Appendix A . The units are also always specified in the values’ metadata which is available via the REST API in the meta.units property. Besides the units property, meta provides a lot of other useful information for consumers of the data. Finally, each data object also has a timestamp property which represents the time that the value was measured. Timestamps are in ISO 8601 format – specifically the RFC 3339 extension format, which is slightly more strict than the ISO specification. For instance, it requires four digit years and specifies that T is used as a separator between the data and time portions of the timestamp. The ordering of keys is also not important, they can occur in any order. In fact, if you are designing a device which consumes Signal K data, it is important to remember that the JSON standard does not guarantee the order of properties in an object. You MUST NOT rely on the data you receive to always be in the same order within a Signal K message. The full format is most useful for getting the initial state of a Signal K system, for example when a display device first connects to the network or for refreshing a device‘s state when it loses a network connection. However sending the full data model is wasteful of both bandwidth and CPU, especially when there is a large amount of available data, or the consuming device is only interested in a small portion of it. In the majority of cases, it is preferable to only exchange small, specific portions of the data.

