By far, the most commonly produced Signal K format is the delta format. Conceptually, the delta is an update to an existing Signal K data model. A device consuming deltas could either build up a view of the Signal K full tree by consuming and combining deltas or it could request from a Signal K server the current full tree model and apply deltas to that as they are received. It is also entirely possible for a device to remain essentially stateless and treat Signal K deltas as independent packets of data, much the same way as it would handle NMEA sentences or PGNs. An example delta message is presented below. { "context": "vessels.urn:mrn:imo:mmsi:234567890", "updates": [ { "source": { "label": "N2000-01", "type": "NMEA2000", "src": "017", "pgn": 127488 }, "timestamp": "2010-01-07T07:18:44Z", "values": [ { "path": "propulsion.0.revolutions", "value": 16.341667 }, { "path": "propulsion.0.boostPressure", "value": 45500 } ] } ]
} The top level of a delta message contains an updates property and an optional context property. { "context": "vessels.urn:mrn:imo:mmsi:234567890", "updates": [...]
} The optional context property roots the updates to a particular location in the Signal K tree. If context is missing it is assumed that the data is related to the self context. The self context is the vessel object which the self property of the full model points to. Context is a path from the root of the full tree to the container object , which for vessel related data must refer to a vessel directly under vessels. The delimiter in the context path is . (period). In this case the context is vessels.urn:mrn:imo:mmsi:234567890. All subsequent data is relative to that location. The updates property holds a JSON array of update objects, each of which may have a source property, a timestamp property and an array of values containing one or more value objects. { "source": { "label": "N2000-01", "type": "NMEA2000", "src": "115", "pgn": 128267 }, "timestamp": "2014-08-15T16:00:00.081Z", "values": [ { "path": "navigation.courseOverGroundTrue", "value": 2.971 }, { "path": "navigation.speedOverGround", "value": 3.85 } ]
} An update has a single source value and it applies to each of the values items. In cases where data can only come from a single source, such as an NMEA 0183 talker connected to a serial port, then the source may be omitted. However, if the delta is being passed on by a Signal K server or multiplexer then source must be filled in by the server so that downstream consumers can discern where the update comes from. In cases where a Signal K producer does not have access to a real time clock or GPS time then timestamp should be omitted. Elements in the Signal K processing chain-such as a server receiving data from a producer-should fill in timestamp if it is missing in the incoming delta message. Each value item is then simply a pair of path and value. The path must be a leaf path : it must be a path to a leaf the of the full model. A leaf is where the actual value of the Signal K property is and where timestamp, $source and values properties are in the full model. The value is often a scalar-a single numeric value, as in the example above-but it can also be an object. For example a navigation.position value would be an object like {"latitude": -41.2936935424, "longitude": 173.2470855712}. There are some static properties in the full model that lack the support for multiple values and metadata such as source and timestamp. An example is a vessel‘s name, directly under the vessel‘s root. This static data may appear in the delta stream, for example when received in AIS transmission. In this case the value should be the subtree of the full model, starting from the vessel's root, with just the relevant parts, and the path must be empty, indicating that the value should be merged to the full model mounted where the delta‘s context property points: { "context": "vessels.urn:mrn:imo:mmsi:234567890", "updates": [ { "source": {...}, "timestamp": "2014-08-15T19:02:31.507Z", "values": [ { "path": "", "value": { "name": "WRANGO" } } ] } ]
}

