We have an existing JSON Schema, let’s call this 1.0.0: { "type": "object", "$schema": "http://json-schema.org/draft-04/schema#", "id": "https://signalk.org/demospecification/1.0.0/schemas/groups/communication.json#", "description": "Schema describing the communication child-object of a Vessel.", "title": "communication", "properties": { "dscAddress": { "type": "string", "description": "MMSI Callsign for VHF communication" } }, "required": ["dscAddress"], "additionalProperties": false
} Now we want to add an additional field to our schema: { "type": "object", "$schema": "http://json-schema.org/draft-04/schema#", "id": "https://signalk.org/demospecification/1.0.1/schemas/groups/communication.json#", "description": "Schema describing the communication child-object of a Vessel.", "title": "communication", "properties": { "dscAddress": { "type": "string", "description": "MMSI Callsign for VHF communication" }, "phoneNumber": { "type": "string", "description": "Phone number of skipper", "example": "+64xxxxxx" } }, "required": ["dscAddress"], "additionalProperties": false
} Because our new phoneNumber field is not a required field, and because version 1.0.0 had additionalProperties set to false, we know that all historical data will work with this new schema, ie. any json which validates against 1.0.0 will also be valid against 1.0.1. Therefore we are looking at an ADDITION, and so we bump the schema version to 1.0.1.

111.body:
Let’s now make our JSON Schema support additionalProperties - this constitutes another ADDITION, so we are now on 1.0.2: { "type": "object", "$schema": "http://json-schema.org/draft-04/schema#", "id": "https://signalk.org/demospecification/1.0.2/schemas/groups/communication.json#", "description": "Schema describing the communication child-object of a Vessel.", "title": "communication", "properties": { "dscAddress": { "type": "string", "description": "MMSI Callsign for VHF communication" }, "phoneNumber": { "type": "string", "description": "Phone number of skipper", "example": "+64xxxxxx" } }, "required": ["dscAddress"], "additionalProperties": true
} After a while, we add a new field, callsignHf: { "type": "object", "$schema": "http://json-schema.org/draft-04/schema#", "id": "https://signalk.org/demospecification/1.1.0/schemas/groups/communication.json#", "description": "Schema describing the communication child-object of a Vessel.", "title": "communication", "properties": { "dscAddress": { "type": "string", "description": "MMSI Callsign for VHF communication" }, "phoneNumber": { "type": "string", "description": "Phone number of skipper", "example": "+64xxxxxx" }, "callsignHf": { "type": "string", "description": "Callsign for HF communication", "example": "ZL3RTH" } }, "required": ["dscAddress"], "additionalProperties": true
} Will this new schema validate all historical data? Unfortunately we can’t be certain, because there could be historical JSONs where the analyst added their own callsignHf field which was not a string. So we are effectively making a REVISION to the data schema - so we bump the version to 1.1.0 (resetting ADDITION to 0).

