It is quite possible for a key value to come from more than one device. Many modern devices have a built in GPS receiver and as a result on any given boat there may be several sources of position, speed over ground, and heading. Multiple depth sounders are also common, often installed to port and starboard on monohull sailboats or in each hull of a catamaran. Given that the validity of these various sources of data may change in a context-specific way, Signal K provides a mechanism for these values to be grouped together so that the consumer of the data may choose which value (or values) to display 1 . When dealing with multiple sources of data, it becomes important to know where the data is coming from. Signal K provides a mechanism for that in the form of the sources top level object and references into that object via the $source property. See sources for detailed information on the structure of the sources object and how it is referenced by the $source property. The first source of a particular data point becomes the default source for that data and a normal Signal K object is created. { "self": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d", "version": "0.9.0", "vessels": { "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d": { "uuid": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d", "navigation": { "courseOverGroundTrue": { "value": 3.61562407843144, "$source": "ttyUSB0.GP", "timestamp": "2017-04-03T06:14:04.451Z" } } } }
} It has come from device sources.ttyUSB0.GP, where further details can be found. If another value with different source arrives, the Signal K server will add the values attribute with values from both the first and second sources. The initial source‘s data will continue to populate the value property in the key. { "self": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d", "version": "0.9.0", "vessels": { "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d": { "uuid": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d", "navigation": { "courseOverGroundTrue": { "value": 3.615624078431440, "$source": "ttyUSB0.GP", "timestamp": "2017-04-03T06:14:04.451Z", "values":{ "ttyUSB0.GP.RMC":{ "value": 3.615624078431440, "timestamp": "2017-04-03T06:14:04.451Z" }, "n2k.ikommunicate.128267":{ "value": 3.615624078431453, "timestamp": "2017-04-03T06:14:04.451Z" } } } } } }, "sources":{ "ttyUSB0": { "GP": { "sentences": { "RMC": "2017-04-03T06:14:04.451Z" } } }, "ikommunicate": { "2": { "n2k": { "src": "2", "pgns": { "128267": "2017-04-03T06:14:05.221Z" } } } } }
}

