By default a Signal K server will provide a new WebSocket client with a delta stream of the vessels.self record, as updates are received from sources. E.g. /signalk/v1/stream will provide the following delta stream, every time the log value changes. { "context": "vessels.urn:mrn:imo:mmsi:234567890", "updates": [ { "source": { "label": "N2000-01", "type": "NMEA2000", "src": "115", "pgn": 128275 }, "values": [ { "path": "navigation.trip.log", "value": 43374 }, { "path": "navigation.log", "value": 17404540 } ] } ]
} Below we refer to WebSockets, but the same process works in the same way over any transport. E.g. for a raw TCP connection the connection causes the above message to be sent, and sending the subscribe messages will have the same effect as described here. This can be a lot of messages, many you may not need, especially if your boat has many sensors, or other data sources. Often you will want to subscribe to a much smaller range of data. Especially for single value displays, it does not make sense to get the entire data stream when only a single value is wanted. First you will want to unsubscribe from the current default (or you may have already connected with ws://hostname/signalk/v1/stream?subscribe=none). To unsubscribe all create an unsubscribe message with wildcards and send the message over the WebSocket connection: { "context": "*", "unsubscribe": [ {"path": "*"} ]
} To subscribe to the required criteria send a suitable subscribe message: { "context": "vessels.self", "subscribe": [ { "path": "navigation.speedThroughWater", "period": 1000, "format": "delta", "policy": "ideal", "minPeriod": 200 }, { "path": "navigation.logTrip", "period": 10000 } ]
} path=[path.to.key] is appended to the context to specify subsets of the context. The path value can use the wildcard *. A wildcard in the middle of a path (propulsion/*/oilTemperature) allows any value for that part and a wildcard at the end (propulsion/port/*) matches all paths beginning with the specified prefix. The following are optional, included above only for example as it uses defaults anyway: period=[millisecs] becomes the transmission rate, e.g. every period/1000 seconds. Default: 1000 format=[delta|full] specifies delta or full format. Default: delta policy=[instant|ideal|fixed]. Default: ideal. (does not apply to meta - see below) instant means send all changes as fast as they are received, but no faster than minPeriod. With this policy the client has an immediate copy of the current state of the server. ideal means use instant policy, but if no changes are received before period, then resend the last known values. fixed means simply send the last known values every period. minPeriod=[millisecs] becomes the fastest message transmission rate allowed, e.g. every minPeriod/1000 seconds. This is only relevant for policy='instant' to avoid swamping the client or network. You can subscribe to multiple data keys multiple times, from multiple apps or devices. Each app or device simply subscribes to the data it requires, and the server and/or client implementation may combine subscriptions to avoid duplication as it prefers on a per connection basis. At the same time it is good practice to open the minimum connections necessary, for instance one WebSocket connection shared between an instrument panel with many gauges, rather then one WebSocket connection per gauge.

