} Alarm objects that have been raised this way must be cleared manually, or by the process that created them. You can use any suitable path, keeping in mind the context of the alarm. eg In the case of an alert, create a unique key by generating a path: The alarm is : vessels.[uuid].notifications.navigation.gnss The alarm object is { "value": { "method": ["visual"], "state": "alert", "message": "GPS signal lost!" }, ...
