The client should send a the following message { "requestId": "1234-45653-343454", "login": { "username": "john_doe", "password": "password" }
} If the login is successful, the server will send a response like the following: { "requestId": "1234-45653-343454", "state": "COMPLETED", "result": 200, "login": { "timeToLive": 86400, "token": "eyJhbGciOiJIUzI1NiIsI...ibtv41fOnJObT4RdOyZ_UI9is8" }
} If the login fails, the server will send a response like the following: { "requestId": "1234-45653-343454", "state": "COMPLETED", "result": 401
