} Reply Messages Any validation request results in one of the following messages On success: { "requestId": "1234-45653-343454", "state": "COMPLETED", "result": 200, "validate": { "token": "eyJhbGciOiJIUzI1NiIsI...ibtv41fOnJObT4RdOyZ_UI9is8" }
} On error (result could be any HTTP code): { "requestId": "1234-45653-343454", "state": "COMPLETED", "result": 401
}

