The exact format of the message for a specific request is defined elsewhere in the specification. A request must include a client generated requestId. TherequestId is a string and it must be a version 4 UUID . It will always be included in any response to the request by the server. For example, a request to PUT a value: { "requestId": "123345-23232-232323", "put": { "path": "electrical.switches.anchorLight.state", "value": 1 }
} The server will respond with a message which includes the requestId, a state, and a statusCode. The state can be FAILED, PENDING or COMPLETED. The statusCode will be any standard HTTP code including the following. 200 - the request was successful 400 - something is wrong with the client's request 401 - the request has not been applied because it lacks valid authentication credentials 403 - the client does not have permission to make the request 405 - the server does not support the request 502 - something went wrong carrying out the request on the server side 504 - timeout on the server side trying to carry out the request The message can optionally contain an informational, human oriented message. The response object may contain other response data depending on the specific request being made. For example, a response to an authentication request could contain a login object. { "requestId": "123345-23232-232323", "state": "COMPLETED", "statusCode": 200, "login": { "token": "....." }
} A server may respond to a request multiple times depending on how it processes the request.

