HTTP requests use REST API semantics and the responses are similar to the response object used above. One difference is that the statusCode value is also sent as the HTTP response code. The response when a server successfully processes a login request synchronously: HTTP response code 200 { "requestId": "123345-23232-232323", "state": "COMPLETED", "token": "eyJhbGciOiJIUzI1NiI...aQ8sN1XBAP8bt3tNBT1WiIttm3qM", "statusCode": 200
} When a request is PENDING, an HTTP 202 (Accepted) code will be returned and the body will include an href to use to check the status of the request. A client should then periodically poll the server to get the status. A client should not poll the server at a rate less than 500ms. HTTP response code 202 { "requestId": "123345-23232-232323", "state": "PENDING", "href": "/signalk/v1/api/actions/12567", "statusCode": 202
} The contents of the response message when checking the status will include the values defined above for the result object and may also include extra information related to the request. For example, the result of a PUT request: { "requestId": "123345-23232-232323", "state": "COMPLETED", "statusCode": 200
}

